  state={users:[]}

  savedata=((data)=>{
    this.setState({users:data});
    console.log("App收到的数据");
    console.log(this.state.users)
  })


  
  render() {
    return (
      <div>
      <div>
      <div className="container">
      
        <Search  savedata={this.savedata}/>
       <List   users={this.state.users}  />
    
  </div> </div>
      </div>
    )
  }
}
